void Start()
{
    rb10 = GetComponent<Rigidbody>(); // Assign the Rigidbody component to rb10
    gobj2 = Resources.Load<GameObject>("PrefabName"); // Load the GameObject prefab from resources folder
}

void Update()
{
    rb10.transform.Translate(4 * Time.deltaTime, 0, 0); // Translate the Rigidbody in the x-axis

    timer += Time.deltaTime;

    if (!instantiate_gobj && timer >= timeLimit)
    {
        a2 = Instantiate(gobj2); // Instantiate the GameObject
        timer = 0;
        instantiate_gobj = true;
    }
    else if (instantiate_gobj && timer >= timeLimit)
    {
        Destroy(a2); // Destroy the instantiated GameObject
        timer = 0;
        instantiate_gobj = false;
    }

    text.text = $"input: {OVRManager.hasInputFocus} - VR: {OVRManager.hasVrFocus}";
}
